                <div class="stl_01" style="top: 42.8129em; left:7.482em;"><span class="stl_11 stl_12 stl_28" style="word-spacing:0.0046em;">※第二步：打开施耐德 </span><span class="stl_14 stl_12 stl_28" style="word-spacing:0.0046em;">PLC</span><span class="stl_11 stl_12 stl_28" style="word-spacing:0.0046em;">编程软件 </span><span class="stl_14 stl_12 stl_28" style="word-spacing:0.0046em;">SoMachine</span><span class="stl_11 stl_12 stl_28" style="word-spacing:0.0046em;">，创建新项目，出现如下页面请点击“管理 &nbsp;</span></div>
